            using (MySqlConnection conn = new MySqlConnection(connectionString))
            {
                conn.Open();

                string insertUsuarios = @"
                    INSERT IGNORE INTO login (id, usuario, senha, tipo) VALUES 
                    (1, 'contato@luzdoamanha.org', @senha, 'Consumidor'),
                    (2, 'contato@sabordaterra.com', @senha, 'Fornecedor');

                    INSERT IGNORE INTO perfil_cons (id, id_login, nome, cnpj, email, senha, telefone, cep, numero, endereco, complemento, transporte) 
                    VALUES (1, 1, 'Instituto Luz do Amanhã', '23456789000110', 'contato@luzdoamanha.org', @senha, '84999991111', '59120000', '100', 'Rua Esperança', 'Casa verde, fundos', true);

                    INSERT IGNORE INTO perfil_forn (id, id_login, cnpj, razao_social, nome_fantasia, email, senha, telefone, cep, numero, endereco, complemento, categoria, transporte) 
                    VALUES (1, 2, '67890123000144', 'Restaurante Sabor da Terra ME', 'Sabor da Terra', 'contato@sabordaterra.com', @senha, '84995552222', '59210400', '200', 'Avenida Brasil', 'Galpão 5', 'Restaurante', false);
                ";

                using (MySqlCommand cmdUsuarios = new MySqlCommand(insertUsuarios, conn))
                {
                    cmdUsuarios.Parameters.AddWithValue("@senha", senhaHasheada);
                    cmdUsuarios.ExecuteNonQuery();
                }

                long contagemDeProdutos = 0;
                using (MySqlCommand cmdCount = new MySqlCommand("SELECT COUNT(*) FROM produto", conn))
                {
                    contagemDeProdutos = (long)cmdCount.ExecuteScalar();
                }

                if (contagemDeProdutos == 0)
                {
                    try
                    {
                        Produtos produtosSql = new Produtos();

                        string base64Cesta = "";
                        string base64Leite = "";

                        byte[] imagemCestaBytes = Convert.FromBase64String(base64Cesta);
                        byte[] imagemLeiteBytes = Convert.FromBase64String(base64Leite);

                        Produto cestaBasica = new Produto
                        {
                            IdForn = 1,
                            NomeProduto = "Cesta Básica",
                            Categoria = "Mercado",
                            Validade = "31/12/2025",
                            Quantidade = 10,
                            Descricao = "Cesta com arroz, feijão, óleo e macarrão",
                            Imagem = imagemCestaBytes
                        };

                        Produto leiteIntegral = new Produto
                        {
                            IdForn = 1,
                            NomeProduto = "Leite Integral",
                            Categoria = "Mercado",
                            Validade = "01/10/2025",
                            Quantidade = 20,
                            Descricao = "Pacote com 12 unidades",
                            Imagem = imagemLeiteBytes
                        };

                        produtosSql.InserirProduto(cestaBasica);
                        produtosSql.InserirProduto(leiteIntegral);
                    }
                    catch (Exception ex)
                    {
                        MessageBox.Show("Falha ao inserir produtos de exemplo: " + ex.Message);
                    }
                }
            }
        }
    }
}


